import React from "react";
import { Link } from "react-router-dom";
import logo from '../images/logo.png'
// Uncomment if you have a logo
// import logo from '../path/to/logo.png'; 

export const NavBar = () => {
  return (
    <nav className="bg-gray-800 p-4">
      <div className="container mx-auto flex justify-between iteams-center">
        {/* Logo Section */}
        <div className="text-white flex item-center font-bold text-xl">
          {/* If you have a logo, use this */}
          <Link to="/">
            <img src={logo} alt="Logo" className="h-10 m-1" />
          </Link>
          <Link to="/">FITBITFUSION</Link>
        </div>

        {/* Nav Links */}
        <ul className="flex space-x-6 text-white">
          <li>
            <Link to="/" className="hover:text-gray-400">
              Home
            </Link>
          </li>
          <li>
            <Link to="/about" className="hover:text-gray-400">
              About
            </Link>
          </li>
          <li>
            <Link to="/services" className="hover:text-gray-400">
              Services
            </Link>
          </li>
          <li>
            <Link to="/contact" className="hover:text-gray-400">
              Contact
            </Link>
          </li>
        </ul>
      </div>
    </nav>
  );
};
